import React from "react";

const Weather = props => {
  return (
    <div>
      <h3>Weather in Austin, TX</h3>
      <span>current Temperature: </span>
      <h1>63F</h1>
      <table>
        <tr>
          <td>Daily High</td>
          <td>65F</td>
        </tr>
        <tr>
          <td>Daily Low</td>
          <td>48F</td>
        </tr>
      </table>
    </div>
  );
};

export default Weather;
